var aryDevice = [];
var uplinkTopic={};
var advTopic={};
var dataGPS = {};

for(var key in msg.payload){
    if(key.indexOf("uplink")  > -1)
        uplinkTopic = msg.payload[key];
    else
        advTopic = msg.payload[key];
}

aryDevice[0] = uplinkTopic.devaddr;
var tempPowerSrc = advTopic.Device.PowerSrc;
switch (tempPowerSrc){
    case 0:
        aryDevice [1] = ("NA");
        break;
    case 1:
        aryDevice [1] = ("Line power");
        break;
    case 2:
        aryDevice [1] = ("Device battery");
        break;
    case 3:
        aryDevice [1] = ("Line power+Device battery");
        break;
    default:
        aryDevice [1] = ("Reading error!!!");
}
aryDevice[2] = advTopic.Device.BatteryLevel;
aryDevice[3] = uplinkTopic.fcnt;
aryDevice[4] = uplinkTopic.lsnr;
aryDevice[5] = uplinkTopic.rssi;
aryDevice[6] = advTopic.Device.Time;
var tempDate = new Date();
aryDevice[7] = tempDate.toGMTString(aryDevice[6]);
aryDevice[6] = aryDevice[6] + " UTC";

msg.payload = aryDevice;
dataGPS.payload = advTopic.Device.GNSS;
return [msg, dataGPS];

