//msgSplit[1]~[4] are DI{};  msgSplit[5]~[8] are AI{}
var DI_list = [];   //extract "DI" key value
var AI_list = [];   //extract "AI" key value
var RTU0_list =[];
//var Device_List[];
var DI_payload = [];   //store "DI" key value
var AI_payload = [];
var RTU0_payload = [];//store "AI" key value
var DI_counter_overflow =[];//indicate the alarm for counter overflow, store in msgDI.color
var AI_alarm =[];//indicate the alarm AI, store in msgAI.color
var msgDI={ payload: 0 , color: ""};   //output DI status, mode,value; msgDI.color contents the alarm for counter overflow
var msgAI={ payload: 0 , color: ""};   //output AI status, mode,value; msgAI.color contents the alarm
var msgRTU0={ payload: 0 , color: ""};   //output AI status, mode,value; msgAI.color contents the alarm
var DI_value_FOR_CHART = [];
var RTU0_value_FOR_CHART = [];
var msgDI_FOR_CHART = { payload: 0 }; //output for DI history chart
var msgRTU0_FOR_CHART = { payload: 0 }; //output for RTU0 history chart
var temp=0;    // onlly for calculation

for(var key in msg.payload){
    if (key[0] =="D" && key[1]=="I")
    {
        DI_list.push({"key":  key,
        "mode" : msg.payload[key].mode,
        "status" :msg.payload[key].status,
        "value" : msg.payload[key].value});
    }
    else if (key[0]=="R" && key[1]=="t")
    {
        RTU0_list.push({"key":  key, 
        "Status" : msg.payload[key].Status, 
        "Data" :msg.payload[key].Data});
    }
    // if (key[0]=="D" && key[1]=="e")
    // {
    //   // Device_List.push({});
    // }
}
//node.error (DI_list);
//parsing DI wanted values
//DI value is actually inside DI_list[].status 
//Counter value is in DI_list[].value
//So switch case loop is depend on "mode"
//DI has 6 channels, so i=0~3
for (var i=0, j=0; i<6; i++, j++){
	temp=DI_list[i].mode;
	//node.error (temp);
    DI_counter_overflow[i]="white";
	switch (temp){
		case 0:
			DI_payload[j] = ("DI");
			DI_payload[++j] = DI_list[i].value;
			break;
		case 1:
			DI_payload[j] = ("Counter");
			DI_payload[++j] = DI_list[i].value;
            if (((DI_list[i].status>>2)&0x01)==1)
                DI_counter_overflow [i]=("red");
            else
                DI_counter_overflow [i]=("white");
            break;
		case 2:
			DI_payload[j] = ("LowToHighLatch");
			DI_payload[++j] = (DI_list[i].status>>4)&0x01;
			break;
		case 3:
			DI_payload[j] = ("HighToLowLatch");
			DI_payload[++j] = (DI_list[i].status>>5)&0x01;
			break;
		case 4:
			DI_payload[j] = ("Frequency");
			DI_payload[++j] = DI_list[i].value;
			break;
		case 255:
			DI_payload[j] = ("UDI disable");
			break;
		default:
			DI_payload[++j] = ("Reading error!!!");
	}
            //node.error (DI_payload[j]);
    DI_value_FOR_CHART[i]=DI_list[i].value;
}
temp = 0;
for (i=0, j=0; i<12; i++, j++)
{
    temp = RTU0_list[i].Status;
    switch (temp)
    {
        case 0:
            RTU0_payload[j] = "Active";
            RTU0_payload[++j] = RTU0_list[i].Data;
            RTU0_value_FOR_CHART[i]= RTU0_list[i].Data;
            break;
        case 17:
            RTU0_payload[j] = "Non Active";
            RTU0_payload[++j] = "N/A";
            break;
    }

}

msgDI.payload = DI_payload;
msgDI.color=DI_counter_overflow;
msgDI_FOR_CHART.payload=DI_value_FOR_CHART;
msgRTU0.payload = RTU0_payload;
msgAI.color=AI_alarm;
msgRTU0_FOR_CHART.payload=RTU0_value_FOR_CHART;


return [msgDI, msgDI_FOR_CHART, msgRTU0, msgRTU0_FOR_CHART];

